    val options = remember { mutableStateListOf<Book>() }
    val data = Gson().fromJson(bookResponse,Array<Book>::class.java)
    var clicked by remember {
        mutableStateOf("")
    }
    val favoritedList = remember { mutableStateListOf<Book>() }
    LaunchedEffect(key1 = Unit, block = {
        data.forEach {
            options.add(it)
        }
    })
    Column()
    {
        Row(Modifier.padding(top = 30.dp, start = 20.dp))
        {
            Button(
                onClick = {
                    clicked = "title"
                    options.sortBy { it.title }
                },
                colors = ButtonDefaults.buttonColors(
                    containerColor = if (clicked == "title") Color.Black else Color.Blue,
                    contentColor =  Color.White
                )
            ) {
                Text("Sort By title")
            }
            Spacer(modifier = Modifier.width(10.dp))
            Button(
                onClick = {
                    clicked = "hits"
                    options.sortBy { it.hits }
                },
                colors = ButtonDefaults.buttonColors(
                    containerColor = if (clicked == "hits") Color.Black else Color.Blue,
                    contentColor = Color.White
                )
            ) {
                Text("Sort By Hits")
            }
        }
        Spacer(modifier = Modifier.height(10.dp))
        LazyColumn()
        {
            items(options) { book ->
                BookCard(modifier = Modifier.clickable {
                    navController.navigate(
                        "${Routes.BOOK_DETAILS_SCREEN}?book=${Gson().toJson(book)}&isFavorite=${
                            favoritedList.contains(
                                book
                            )
                        }"
                    )
                }, book = book, isFavorite = favoritedList.contains(book), onChange = {
                    if (favoritedList.contains(book)) {
                        favoritedList.remove(book)
                    } else {
                        favoritedList.add(book)
                    }
                })
            }
        }
    }
}
